import React,{useState} from 'react'
import "/Users/alokwaigaonkar/health_care/src/css/navbar.css"
import Logo from "../images/logo.png"


export default function Navbar() {
  const [text , setText]=useState("")
  const [error , setError]=useState("Patient Name")


  const handleInputChange=(event)=>{
    const search=event.target.value
    setText(search)
  }

  const handleOnSubmit=(event)=>{
    event.preventDefault()
    // if(text===""){
    //   setError("Search field can't be empty")
    // }
  }

  return (
    <div>
    <nav className="navbar">
    <a class="navbar-brand" href="#"><img src={Logo} alt="Logo" style={{width:"80px"}} /></a>

    <form role="search" onSubmit={handleOnSubmit}>
        <input className="input-section" type="search"  placeholder={error} aria-label="Search" onChange={handleInputChange} />
        <button type="submit" className="btn nav-btn btn-outline-success m-4 " >Submit</button>
    </form>
    </nav>
    </div>
  )
}
